import React from "react";

export const Tile = ({tile, values}) => {
  return (
    <div className="tile-container">
      {Object.values(values).map((item, index) => (<p className={index === 0 ? "title-tile" : "tiles"}>{item}</p>))}
    </div>
  );
};



